Treasure Hunters

History Documentary hosted by Gordon Gould, published by Discovery Channel in 2000 - English narration


Information
------------------------------

Treasure - buried, lost or sunk, in the depths of the ocean - has fascinated countless treasure hunters throughout the world, in all lands and seas, for centuries.
This series follows the trails to the sites of legendary treasures, presents the winners and losers in the hunt for treasures trove. The films document the historical events surrounding certain treasures and relate the dreams, dramas and adventures of obsessed treasure hunters who shun no risk in their search for the &quot;pot of gold&quot;, and seamlessly weaves together history and legend to present compelling tales of real life human quests. 

Director : Sylvio Heufelder
Camera : Juergen Jungnickel
Narrator : Gordon Gould
Executive Producer : Cheryl Blue
Tandem Film 2000



9)  Diamonds of the Orange River 
Pure beauty, ultimate perfection, every stone a miracle itself. The contemporary diamond era begins in South Africa. Less than a hundred years ago the first discoveries were made on the banks of the Orange River. It would mean the beginning of the hi-tech technology searching to the seabed of the Atlantic.



